import React from 'react';
import Landing from './pages/landing/landing';
import CreateTalent from './pages/createTalent/createTalent';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
import './App.sass';


var App = () => {

  return (
    <Router>
    <Switch>
          <Route path="/" >
            <LandingPage/>
          </Route>
          <Route path="/create_talent">
            <CreateTalentPage/>
          </Route>
        </Switch>
    </Router>
  );
}

export default App;
